INSERT INTO `story` (`storyID`, `storyAuthor`, `storyDate`, `storyTitle`, `storyBoard`, `storyView`, `storyMedia`) VALUES
(1, 'Elsa Reyes-Amaya', '2020-11-02', 'Pregnancy and COVID-19: Elsa’s Story', 'Elsa Lisseth Reyes-Amaya was pregnant when she was hospitalized for a serious case of COVID-19. Multiple departments across Johns Hopkins Medicine worked together to treat her and monitor her pregnancy. Four months later, Elsa safely delivered her daughter, Sofia.\r\n\r\nIn late March, Elsa developed a headache. She started to run a slight fever and noticed some body aches. She called her doctor, who said it was probably due to her body experiencing pregnancy changes.\r\n\r\nA little over a week later, Elsa had nausea, diarrhea and vomiting, and just a few days later, there was a new, troubling symptom: She was having difficulty catching her breath.\r\n\r\nVictor took Elsa to a nearby hospital on April 13, where she was admitted. Four days later, her condition deteriorated. She developed pneumonia and was transferred to The Johns Hopkins Hospital.\r\n\r\n“Ms. Reyes-Amaya came to the hospital in critical condition,” obstetrician Andrew Satin, M.D., says. “She was experiencing respiratory failure due to sudden, severe pneumonia.”\r\n\r\nElsa was also showing early signs of sepsis, a potentially deadly infection of the bloodstream that can occur in critically ill patients. Satin says that although her initial tests for COVID-19 were negative, further testing showed a positive result: Elsa had SARS-CoV-2, the coronavirus that causes COVID-19.\r\n\r\nElsa says she doesn’t remember much of what happened once she was at Johns Hopkins. But what she does recall makes her cry, especially when she thinks about the dangerous situation she and her unborn baby were in. “It’s still hard to talk about,” she says.\r\n\r\nDespite supportive care at Johns Hopkins, Elsa’s condition continued to worsen.\r\n\r\nSatin explains that during pregnancy, normal changes affecting the lungs help an expectant woman take in and absorb more oxygen as she breathes for herself and her fetus. When pregnant women get pneumonia, these changes can make the illness more severe.\r\n\r\nAt first, Elsa was treated with extra oxygen, but it wasn’t enough. As her breathing became more difficult, she had to be placed on a ventilator. Her care team gave her medicine to put her in a deep sleep. Then, the team inserted a breathing tube into Elsa’s throat to push oxygen into her lungs and, essentially, breathe for her while she was unconscious.\r\n\r\nHer awareness came and went. Like other patients hospitalized with COVID-19 in an intensive care unit (ICU), she experienced troubling nightmares. When she regained consciousness, she was still fearful, and it was only after calling family members that she knew the upsetting dreams were not real.\r\n\r\nElsa has no idea how she caught the coronavirus. She lives in the same home as Victor, his mother and his brother, none of whom came down with COVID-19.\r\n\r\nElsa says her experience made her aware of how serious COVID-19 can be.\r\n\r\n“Do not look at this disease as a game, because it’s terrible,” she says. “I’ve seen other people who go out and do not take precautions. I am not a doctor, but I do know that if we end up having to live with COVID-19 in our community, people will have to take care of themselves and their families and stay safe.”\r\n\r\nElsa says she had some lingering anxiety, even when she returned home to her family. “I was so afraid of getting sick again. But my baby gave me strength.”', 32, );
INSERT INTO `story` (`storyID`, `storyAuthor`, `storyDate`, `storyTitle`, `storyBoard`, `storyView`, `storyMedia`) VALUES
(2, 'Theirrien Clark', '2020-09-15', 'Coronavirus and COVID-19 Recovery: Theirrien’s Story', 'Theirrien, whom his wife Marcy describes as a very active “hyper superman,” works as a senior operations manager at an international law firm in Washington, D.C. Though he’d had a bad bout of pneumonia five years ago, he generally was in good health.\r\n\r\nIn March 2020, he developed a stubborn low fever and a cough. Marcy seemed to be coming down with something, too. When his cough grew worse, they both went to Howard County General Hospital and were tested for SARS-CoV-2, the coronavirus that causes COVID-19.\r\n\r\n“With all the personal protective equipment on, the care providers looked like Martians,” Theirrien says. “Everyone was nervous and on edge.”\r\n\r\nAfter self-quarantining at home, Theirrien and Marcy got their results: both positive. “We were in it together,” Marcy recalls. At that point, she notes, Howard County, Maryland, where the couple lives, was only reporting three cases. “I guess we were four and five,” she says.\r\n\r\n“It was so emotional when they were clapping for me,” Theirrien Clark says. When the 56-year-old Maryland man was wheeled out of the intensive care unit (ICU) at The Johns Hopkins Hospital, his care team — and others on the floor — took a moment and applauded. \r\n\r\nThey had reason to celebrate: Theirrien had beaten steep odds. Severely ill with COVID-19, he had spent more than four weeks in the ICU — and almost lost his life.', 35, );
INSERT INTO `story` (`storyID`, `storyAuthor`, `storyDate`, `storyTitle`, `storyBoard`, `storyView`, `storyMedia`) VALUES
(3, 'Karen Nitkin', '2020-06-03', 'Gerry and Georgene Stephens: Savoring Life Together After COVID-19', 'More than 100 nurses, physicians, other clinicians and support staff cared for Gerry and Georgene Stephens, a couple hospitalized for COVID-19 at The Johns Hopkins Hospital—he for three weeks and she for two days. “I was asleep for two thirds of my stay… Yesterday, I went on a 4-mile hike,” said Gerry. Hear what else he, his wife and members of their inpatient and home care teams had to say about the challenging but successful recovery.\r\n\r\nGerry, 69, and Georgene, 70, were the first couple to both receive treatment for COVID-19 at The Johns Hopkins Hospital. Their ordeal began in early March, when Gerry developed a cough and fever. His condition worsened, and on March 17, they went to Howard County General Hospital, where they were both tested for COVID-19.\r\n\r\nGeorgene, who was asymptomatic, was sent home. But Gerry, feverish and struggling to breath, was intubated and taken by ambulance to The Johns Hopkins Hospital, where he was treated in the hospital’s Biocontainment Unit.\r\n\r\nThe test results, which came back March 18, showed that both Gerry and Georgene had the new coronavirus. Georgene’s symptoms emerged later that week. “I started feeling lightheaded and funny,” she says, so she called 911 and was taken by ambulance to The Johns Hopkins Hospital.\r\n\r\nAlthough she was treated and discharged the next day, Georgene was at the hospital long enough to get visits from Garibaldi and several nurses who were treating her husband.\r\n\r\n“They came in and told me everything, and that made me feel better,” says Georgene. “Once I met Dr. Garibaldi and the other staff members, I knew Gerry was in the best place.”', 14, NULL);
INSERT INTO `story` (`storyID`, `storyAuthor`, `storyDate`, `storyTitle`, `storyBoard`, `storyView`, `storyMedia`) VALUES
(4, 'Sammy Eldin', '2020-04-27', 'Sammy Eldin: A Johns Hopkins Patient Recovering from COVID-19', 'Sammy Eldin, 53, is back home in Howard County after two harrowing weeks battling COVID-19 at The Johns Hopkins Hospital and three days of inpatient treatment for a heart arrhythmia that appears to be COVID-related.\r\n\r\nThough he’s still gaining his strength — his wife, Tina, jokes that he circulates from couch to kitchen to dining room and back again — he’s grateful for his improving health and the care he continues to receive.\r\n\r\nAdmitted March 16 and released March 30, the founding partner of Tricap Investments was one of the first inpatients with COVID-19 at The Johns Hopkins Hospital. Since then, the hospital has treated and released hundreds of patients who had COVID-19 and then recovered from the potentially fatal disease.\r\n\r\n“We were still trying to figure out the trajectory of the illness,” says Brian Garibaldi, M.D., a critical care physician specializing in pulmonary disease, and medical director of the hospital’s biocontainment unit. “It was stressful for him as a patient, but also stressful for us as a care team.”\r\n\r\nEldin, who travels frequently for work, flew home to Dulles International Airport on March 8 from a two-week trip to Asia and London. During his travels, he took pains to sanitize his hands frequently, and even avoided food on the flight.\r\n\r\nBut three days later, he developed a fever, and the following day, March 12, it spiked to nearly 103. Though he did not have the classic COVID-19 symptoms of a sore throat, cough or shortness of breath, Eldin was worried, especially when acetaminophen brought only limited relief.\r\n\r\nOn March 16, at the urging of his Johns Hopkins primary care doctor Hamid Rabb, M.D., Eldin went to The Johns Hopkins Hospital, checking in at the registration tent set up to provide assessment and care while keeping patients who are potentially infectious safely away from other patients in the emergency department.\r\n\r\nAfter about two hours, he was thinking about going home. But emergency doctor Kamna Balhara, M.D., urged him to stay for further evaluation after an X-ray showed signs of infection in his lungs.\r\n\r\n“I’m glad she convinced me to stay,” Eldin says. “If I had gone home and gotten worse over the next several days, I probably would have needed intubation when I returned.”\r\n\r\nEldin was taken to a protected room in the emergency department and a COVID-19 test was performed, which came back positive. He was admitted to one of the first Johns Hopkins Hospital units to be converted to a negative pressure respiratory isolation unit to keep contaminated air from flowing out and posing a risk to other patients and to staff members.\r\n\r\nHospital policy prohibited visitors, but Eldin says he found comfort using a video phone app to keep up with his family, particularly sons Adam, 23, and Zach, 20. “They were quite worried about me,” he says.\r\n\r\nThe biocontainment measures, while necessary, create barriers for clinicians as well as patients, notes Garibaldi.\r\n\r\n“We’re trying to minimize the number of people going into the room and also how much time we spend in the room,” he says, adding that personal protective gear interferes with hearing and touch, and makes smell impossible.\r\n\r\nBecause he couldn’t hear through a stethoscope while wearing a powered air purifying respirator (PAPR), Garabaldi used a hand-held ultrasound device to check lung function and assess the health of other organs. In gratitude, Eldin donated money for the hospital to buy more hand-held ultrasound devices, Garibaldi says.\r\n\r\n“I had a great team of doctors,” Eldin says, including Garibaldi and internists Romsai Boonyasai, M.D., M.P.H.; Gigi Liu, M.D., M.Sc.; and Timothy Niessen, M.D., M.P.H.“I can’t tell you how professional, nice and friendly the nursing staff was. Even the food was fantastic, once I figured out how to navigate the extensive menu.”\r\n\r\nWhen acetaminophen failed to lower Eldin’s temperature, the team, who was closely monitoring him, tried hydroxychloroquine, an immunosuppressive drug for which the FDA recently issued medical use guidance. The drug is being used experimentally for COVID-19 treatment, but is still under scientific investigation among experts across the nation who are responding to the pandemic.\r\n\r\n“I think it helped me because about 48 hours after I started it, my stubborn fever finally broke,” Eldin says. “But that’s when my breathing problems started.” He was put on oxygen, but after a couple of days “it got so bad I had to go to the ICU,” he says.\r\n\r\nThere, he was treated with a high-flow nasal cannula, and fortunately never required a ventilator. As his condition improved, doctors gradually decreased the amount of oxygen he received and then released him from the ICU.\r\n\r\nEldin was discharged March 30, going home to the small farm he shares with his wife, sons and two Arabian horses.\r\n\r\nDoctors and nurses with a COVID-19 follow up team call Eldin several times each week to check on his progress. He also uses an oxygen machine supplied by the Johns Hopkins Home Care Group several hours per day.\r\n\r\nYet his oxygen levels remained low, causing his heart to beat too fast. He was readmitted to The Johns Hopkins Hospital on April 19 with heart palpitations, receiving treatment in a non-COVID-19 unit before being released again two days later.\r\n\r\nBecause the disease is so new, it is not known if Eldin’s lungs will fully heal, says Garibaldi.\r\n\r\n“Sammy was one of the first patients with COVID-19 under my care,” Garibaldi says. “He was one of the first to slowly get worse and transition to ICU, and then get better, which is something we see more of now. He was one of the first we treated with a high-flow nasal cannula.”\r\n\r\n“I remember him certainly for those reasons, but I also remember him because he’s a very thoughtful guy, very insightful,” says Garibaldi. “One of the big challenges of working in this environment is making sure we don’t lose sight of the patient’s story. Sammy is a reminder of the importance of developing those relationships.”', 7, );
INSERT INTO `story` (`storyID`, `storyAuthor`, `storyDate`, `storyTitle`, `storyBoard`, `storyView`, `storyMedia`) VALUES
(5, 'Ahmad Ayyad', '2020-05-13', 'Ahmad Ayyad: Getting Strong Again After COVID-19', 'Ahmad Ayyad, 40, was in great shape.\r\n\r\nA chiseled 215 pounds on a 6’1” frame, he competed in demanding obstacle course races that had him scrambling over walls and under barbed wire, lugging heavy objects, and traversing monkey bars and rings.\r\n\r\nOn a typical day, he’d work in his family’s retail furniture business, then box and lift weights, before heading to his Washington, D.C., home. He played basketball several times a week.\r\n\r\nAnd then, COVID-19 almost killed him.\r\n\r\nAyyad was on a ventilator at The Johns Hopkins Hospital for 25 days and lost more than 60 pounds during his ordeal. His doctors say his physical fitness, positive attitude and the support of friends and family are helping him recover from the disease and the toll of long-term ventilation.\r\n\r\nDischarged on April 22, Ayyad still has a blood clot in his left arm and damage to his heart and lungs — all complications of COVID-19. But he is gradually putting on weight and has begun running and lifting weights.\r\n\r\n“He seems to be making a great recovery,” says Sandra Zaeh, M.D., a pulmonary and critical care medicine fellow, who treated Ayyad in the hospital and continues to care for him as part of a follow-up team called PACT, for Post-Acute COVID Team.\r\n\r\nDescribing a May 5 video consultation, she says: “It was remarkable to go from seeing him at his sickest in the ICU — intubated, deeply sedated and on his stomach to help him breathe — to seeing him at home. He was smiling and talking about how happy he was to go for a short jog and sit outside with the sun on his face.”\r\n\r\nThe COVID-19 pandemic is still too new for researchers to predict with certainty who gets sickest and why. However, many of the hardest-hit patients are older than 65 and have comorbidities, such as obesity or diabetes.\r\n\r\nAnd then there’s Ayyad. “He had no reason why he would be at more risk than anyone else,” says Zaeh. “But there could be factors that we don’t yet fully understand.”', 5, );
INSERT INTO `story` (`storyID`, `storyAuthor`, `storyDate`, `storyTitle`, `storyBoard`, `storyView`, `storyMedia`) VALUES
(6, 'Amy K. Rosen', '2020-10-22', 'Stories Of COVID-19: The Fine Line Between Essential And Non-Essential Care', 'This post is part of a Health Affairs Blog short series, “Stories of COVID-19.” The series presents first-person accounts from patients and providers that highlight policy issues raised by the COVID-19 pandemic and response. For longer-form personal essays about health care, read our long-running Narrative Matters series in the journal.\r\n\r\nThe practice of medical care in the US changed dramatically with the onset of COVID-19. By mid-March 2020, the Centers for Medicare and Medicaid Services (CMS) called for the postponement of non-essential surgeries and other procedures, and limitations on those medical services that could be deferred (such as non-emergent, elective treatment, and preventive medical services), so that medical attention could focus almost exclusively on COVID-19 treatment and prevention. CMS’s goals were both to conserve critical health care resources and to reduce exposure of patients and staff to the virus.\r\n\r\nWhile this was a necessary and critically important step in mitigating the impact of the virus, it had considerable repercussions for patients with non-COVID-19 illnesses. This story is about one such patient, who fell through the cracks due to the changes in medical care practices wrought by the pandemic.\r\n\r\nOn Wednesday, March 11, 2020, my husband Jacob began experiencing excruciating pain in his lower back. We had returned from a three-week hiking and adventure trip in Australia a few days before, and we’d felt exhilarated. By Thursday, Jacob was having terrible muscle spasms in his back. We were fortunate to obtain an in-person appointment for him the next day, just before COVID-19 was declared a national public health crisis. After examining him, the physician assistant concluded that his back pain was probably due to a muscle pull or sprain, which we attributed to the very long flight from Australia. She prescribed muscle relaxants and suggested he rest.\r\n\r\nOver the next few days, his back pain intensified and at times became unbearable. I applied alternating heat and ice to his back, and he began receiving virtual physical therapy. When these treatments didn’t help, his primary care physician prescribed Percocet, but this only made matters worse. The drug led to bouts of confusion, slurred speech, and an unsteady gait, and gave no relief from the back pain. Next, he was prescribed a large dose of steroids, then Advil, but these had no effect either. I began searching for answers in other places, including alternative treatments such as massage and electrical muscle stimulation, but these were also ineffective. The back pain was crippling and limited his mobility and functioning. Eventually, he was unable to completely dress himself.\r\n\r\nOther symptoms that Jacob had been experiencing since mid-February also became more noticeable. While we were in Australia, his appetite had begun to wane, and some foods he had always liked no longer appealed to him. He also complained about “dry mouth.” By early April, family and friends noticed how gaunt he looked during Zoom meetings. And even though it was early April, he often wore his heavy winter jacket in the house.  \r\n\r\nDuring a telemedicine appointment in early April and a follow-up phone call, we brought Jacob’s back pain and other symptoms to his primary care physician’s attention again. The physician told us to be patient and reminded us that back pain takes time to resolve. I reiterated that in our 48 years of marriage, I had never seen my husband lose as much weight as he had (between 15 and 20 pounds) or lose interest in food, and this was a sign to me that something was not right. At last, he agreed to send Jacob for an X-ray of his back, although he still refused my repeated requests for an MRI, explaining that low back pain did not qualify as a medically “essential” service during the COVID-19 pandemic.\r\n\r\nThe X-ray and routine blood tests occurred on April 13. The X-ray showed signs of arthritis in the back and spinal disc slippage, not a surprising finding for someone in his early 70s. The blood tests were more interesting, revealing that Jacob had mild anemia. Because the occurrence of back pain with anemia can be symptoms of multiple myeloma (a type of blood cancer), the primary care physician sent us for additional blood tests, which ruled out multiple myeloma. Jacob’s official diagnosis was anemia of chronic disease or anemia of inflammation, the second most common form of anemia after iron-deficiency anemia. Upon further research, I learned that this type of anemia is present in 18 percent to 95 percent of patients with infections. No additional treatment was recommended for the anemia, his other symptoms, or his back pain beyond rest, time, and physical therapy. We were left without any specific guidance on how to reduce his back pain, which by then, had become an all-day battle. His lack of appetite, dry mouth, and chills also persisted, but without knowing their etiology, we were unable to treat them.\r\n\r\nWe made one more request for a MRI toward the end of April, about six-and-a-half weeks after the onset of the back pain. By then, policies had changed, and MRIs were no longer authorized during COVID-19, regardless of diagnosis, except in the few rare instances where they were considered “essential.” When I learned that a few outpatient centers were still performing MRIs despite COVID-19, I asked for a referral. By the time the doctor finally agreed, it was too late.\r\n\r\nOn Monday morning, April 27, everything changed. Jacob’s episodes of confusion, previously short-lived, became noticeably worse. He could not figure out how to use his cell phone or remember his password. He had difficulty finding the right keys on his computer keyboard. He tried writing but was unable to spell the simplest words. I knew something was terribly wrong. I left two urgent messages for his primary care provider then dialed 911. Within about five minutes, the emergency medical technicians arrived and transported Jacob to the hospital. Despite concern that Jacob might be exposed to COVID-19 during hospitalization, I was relieved that he would finally get the medical care he needed.\r\n\r\nUpon admission, he was given an extensive battery of tests, including brain, neck, and spine MRIs and CT scans, and had his blood drawn. Sometime that day, I was told that Jacob had suffered multiple small ischemic strokes throughout his brain that were caused by bacteria circulating in his bloodstream. This explained his cognitive deficits and episodes of confusion. Infectious disease physicians at the hospital identified osteomyelitis, an infection in the bone located in his lumbar spine—the cause of his low back pain. His blood tests showed elevation of his inflammatory markers. He was started on a general course of intravenous antibiotics and was transferred to the neurology floor, which was his new home for the next week. Once he was settled there, his medical team of neurologists and infectious disease doctors updated me by phone every day.\r\n\r\nAdditional tests, including two echocardiograms of his heart, confirmed a suspected diagnosis of infective endocarditis, an infection caused by bacteria that enter the bloodstream and travel to the heart. The bacterium circulating in his bloodstream was identified as Streptococcus mutans, which typically enters the bloodstream after a dental procedure (which Jacob had in January) or from poor oral hygiene. Once this bacterium was identified, his IV antibiotics were switched to a more targeted antibiotic for treating bone infection and endocarditis. Jacob also received physical therapy, speech cognitive therapy, and occupational therapy, and consults for dental services, cardiology, and orthopedics. Although I had initial concerns about hospital safety, these eventually disappeared when I learned that his private room was located on a non-COVID-19 unit with very few other patients, and that any hospital staff providing care were fully equipped with personal protective equipment.\r\n\r\nOnce new blood cultures continued to show no new growths, Jacob was prepared for discharge. A catheter was placed in a vein in his arm so that he could continue to receive antibiotics at home for an additional six weeks. The doctors made referrals for home health services—nursing services, and physical and speech cognitive therapy—and discharged him on May 4, exactly one week after he was admitted. Hospital charges for the week came to $93,000; final costs have not yet been settled.\r\n\r\nOnce home, we settled into a six-week routine of twice weekly visits from the physical and speech cognitive therapists, weekly visits from a nurse, and weekly deliveries of medical supplies.\r\n\r\nIn a June 2020 article, Tejal Gandhi and Hardeep Singh proposed new nomenclature for diagnostic errors anticipated in the COVID-19 era. Among them is “strain,” which occurs when health care systems become overwhelmed treating COVID-19 patients, leading to missed or delayed care and failure to diagnose. In Jacob’s case, a number of concerning symptoms (including weight loss, diminished appetite, and chills) did not receive the attention they deserved.\r\n\r\nAnother type of diagnostic error anticipated in the COVID-19 era is dubbed “unintended.” These errors occur when there is less direct, face-to-face interaction between patients and their providers. In the absence of in-person physical exams, patients are more likely to get misdiagnosed. Virtual visits and the use of technologies such as telemedicine are generally less effective in monitoring symptoms and detecting the underlying causes of diseases. I suspect that under “normal” circumstances, with in-person visits, follow-up care, formal physical examinations, and in-office laboratory tests and X-rays taken and interpreted the same day, it would have been much easier for the primary care provider to appreciate the seriousness of Jacob’s health issues as well as our high level of concerns. Infective endocarditis is difficult to diagnose in any situation because it can resemble many other illnesses. It can be even harder to diagnose when the patient is seen via a computer or phone screen. Finally, if additional imaging, such as an MRI, had been accessible at the time, it is possible that Jacob’s hospital admission could have been prevented.\r\n\r\nDespite CMS’s tiered framework for prioritizing services for those requiring urgent or essential care, it was the responsibility of local health care systems and clinicians to implement this. Clinicians had to assess what was in the best interests of their patients, evaluate the risks and benefits of any medical treatment/service provided, and determine whether that service, if deterred, would result in patient harm. This meant that decisions about Jacob’s treatment were left entirely up to his primary care provider, who, because of resource constraints and pressures, was poorly equipped to coordinate Jacob’s care in the way that he might have done under more normal circumstances. As Ajay Kirtane, MD, an interventional cardiologist, said recently: “One of the yet-to-be-told stories of the COVID-19 pandemic is the recognition that the (necessary) proscriptions on the performance of less urgent cases has led to collateral damage to so many patients with medical conditions that truly couldn’t wait.”\r\n\r\nThis also raises questions about the line between essential and non-essential services during COVID-19. The definition of these terms depends on local practice patterns, individual health care systems, provider judgments, and trade-offs between performing a procedure that might infect the patient with the virus, or delaying the procedure but increasing the patient’s risk of adverse consequences. The pandemic forced providers to make difficult choices about how to practice medicine, maintain quality of care, and determine who should or should not get care.\r\n\r\nTwo recent studies report on the number of excess deaths from cardiac events, strokes, diabetes, and Alzheimer disease that occurred during the pandemic that likely represent “secondary pandemic mortality caused by disruptions in society that diminished or delayed access to health care.” These studies suggest that up to one-third of excess deaths during the pandemic may occur in those who have not tested positive for COVID-19. Infective endocarditis can be a potentially life-threatening disease if not promptly treated. If he had not been hospitalized when he was, Jacob could have been one of these “excess” deaths.\r\n\r\nAs health care systems begin to provide so-called “non-essential” services again, it is critically important that we learn from the mistakes made during the first wave of the pandemic. While we were effective in improving the care of COVID-19 patients, we were less successful in reliably delivering safe, appropriate, high-quality, and person-centered care to every individual needing treatment. Researchers need to evaluate specific policies, such as CMS’s recommendations to postpone all non-urgent and elective procedures, which can lead to delays in diagnoses and subsequent harmful consequences if treatment is not delivered promptly. Health care systems should develop innovative ways of providing timely and high-quality medical care, affording those patients who truly need care the ability to obtain it. For example, instead of postponing all non-essential services, more granular approaches to delivering care could be instituted, such as screening and triaging procedures of patients needing surgical interventions whose outcomes, if care is delayed, could be adversely affected. Providers, in turn, could implement protocols to identify high-risk patients, optimize workflows, and improve communication with patients when delivering virtual care, since telemedicine is likely to play a prominent role in the future. Finally, patients need to strongly voice their concerns, so that providers will be forced to listen.\r\n\r\nThis story is about the unintended consequences of the COVID-19 pandemic on one patient, my husband. Luckily, he is now on the path to recovery. As a health services researcher, I know something about how the health care system works, and yet I found this experience frightening and overwhelming. Unless we all take responsibility for mitigating the collateral damage that can ensue even from well-intentioned policies, the health care system will fail to honor its most important principle: “First, do no harm.” I am hopeful that my story will inspire others to carry out this challenging, yet critical, task.', 5, NULL);
INSERT INTO `story` (`storyID`, `storyAuthor`, `storyDate`, `storyTitle`, `storyBoard`, `storyView`, `storyMedia`) VALUES
(7, 'Roger and Ria', '2020-09-21', 'What it\'s like to have COVID-19: Roger shares his story', 'This article was written during the Queensland response to the COVID-19 pandemic and reflects the information available at the date of publication. Please check the Queensland Government COVID-19 webpage for updated information and current health advice regarding COVID-19 in Queensland. All information was correct as per the experience of the interviewee at the time of their interview.\r\n\r\nEvery single Queenslander has been touched by the COVID-19 pandemic this year. Whether restrictions have altered your ability to work, you’ve had to cancel plans to see family and friends, you’ve needed to run school at home for your children, or you’ve just been more vigilant with handwashing, each and every one of us has been affected.\r\n\r\nBecause Queenslanders have worked so hard to flatten the curve and slow the spread of COVID-19 in our state, most of us have not directly come into contact with the virus so far, even if it has changed how we live day-to-day. But some Queenslanders have been directly affected by the virus, either because they’ve caught it, because they’ve had to undertake essential travel, or because they work in our hospitals and health systems testing and treating people with COVID-19.\r\n\r\nThis is one of a series of stories of everyday Queenslanders who have had real experiences with COVID-19. We wanted to share these stories to help Queenslanders understand what it’s been like working on the frontlines of this pandemic and what it’s been like to be truly caught up in the virus’s path. These stories are a record of the hard work that has been done and will continue to be done in Queensland, and a reminder about why we need to stay vigilant when it comes to preventing the spread of COVID-19.', 17, );
INSERT INTO `story` (`storyID`, `storyAuthor`, `storyDate`, `storyTitle`, `storyBoard`, `storyView`, `storyMedia`) VALUES
(8, 'Dr Irina Karosanidze', '2021-01-29', 'Georgia’s experience during COVID-19 will inform its future primary health care approaches', 'Dr Irina Karosanidze, a primary health care (PHC) doctor in Georgia is on the frontlines of a dramatic transformation in PHC delivery that will hopefully have a lasting and positive impact on the lives of everyone, everywhere in the country.\r\n\r\n”It is a question of people being able to access health services and receive health care advice when and where they need it. With the rapid acceleration of digital health services due to the pandemic, that can even be at home,” said Irina who is working closely with the Ministry of Internally Displaced Persons from the Occupied Territories, Labour, Health and Social Affairs to adapt PHC services to meet the demands of a global pandemic.\r\n\r\nThanks to leaders like Irina, new protocols were rapidly developed and revised, and PHC providers across the country were trained in managing mild COVID-19 infections remotely.\r\n\r\nBefore COVID-19 struck, the Ministry was already committed to increasing the efficiency of health service delivery in Georgia and advancing universal health coverage (UHC) through strengthening the PHC system and integrating priority services. The population’s health needs were becoming increasingly complex due to the growing burden of noncommunicable diseases (NCDs) such as diabetes, cancer, heart and lung diseases.\r\n\r\nIn November 2019, a WHO mission conducted through the UHC Partnership reviewed the Ministry’s PHC reform plans. It recommended revising the scope of services to include more preventive, people-centred services, expanding the scope of practice of nurses, and redefining the role of specialists in the PHC setting. The review found that lack of performance monitoring and misaligned payment incentives undermined the system’s overall potential. In addition, high out-of-pocket payments for medicines disproportionately affected the poorest people in the population leading to increased poverty and sometimes catastrophic spending on health. \r\n\r\nIn early 2020, the Ministry asked WHO to provide technical support to revise the PHC benefits package and payment model. This would help increase access to evidence-based prevention and treatment services and support the integration of health programmes to strengthen the PHC system. Then, COVID-19 struck.\r\n\r\nWhile Georgia initially experienced low rates of COVID-19 infection, cases rose dramatically throughout the last quarter of 2020. In early 2021 the country is facing a severe epidemic, with PHC called upon to serve a core role.\r\n\r\n“Georgia has launched a strong response to COVID-19 but the pandemic has highlighted the need to accelerate progress to ensure that no one is left behind. Strong robust health systems, primary health care and accessible public health services are the best way we can deliver universal health coverage across the country. These strategies will build resilience against future health emergencies and help get essential services to people in need,” said Dr Hans Henri P. Kluge, WHO Regional Director for Europe during a visit to Georgia in December 2020.', 10, );
INSERT INTO `story` (`storyID`, `storyAuthor`, `storyDate`, `storyTitle`, `storyBoard`, `storyView`, `storyMedia`) VALUES
(9, 'Prince Paul Butau', '2020-04-19', 'HEROES OF THE FRONT LINES 1.0', 'At my hospital we are closed to all outpatient and non-emergency services. We are not a COVID-19 hospital, so the government says we do not need protection equipment. So we only get two masks and a paper apron a day. We have goggles, but we have to sanitize them every day with alcohol. We should have full gear. The feeling among us junior doctors is that this is not enough. I don’t want to risk my life seeing a patient in casualty if I don’t have protection.\r\n\r\nWe don’t know who has COVID or not. Zimbabwe has only tested about 200 people, and they say there are only 11 cases. But I think the government is not being transparent, and it hasn’t done enough to contain the outbreak. I think the numbers are much higher. I am worried that it might explode like in Italy or Iran, but I am just praying it won’t be as bad, because if it explodes like it did in the U.S., I can’t describe in words what it will be like here.\r\n\r\nThere are only a few ventilators in the public hospitals, maybe less than 20 in the whole country. We have one COVID case who died. He was 30. He died because there was no ventilator at his hospital. His family brought one privately, but there was no electricity socket in his room, and they couldn’t plug it in. It shows how unprepared we are as a country. If there was a functioning system, he would have been fine. If we were not prepared for that one case, how can we handle more?\r\n\r\nIf we can’t stop it, if we can’t treat it, I am afraid we will become the next example of just how bad an outbreak can be. But I fear it will be even worse here. It will be the absolute worst-case scenario in the world. In the future, people will point to Zimbabwe and say, that is how bad an outbreak can be. ', 7, );
INSERT INTO `story` (`storyID`, `storyAuthor`, `storyDate`, `storyTitle`, `storyBoard`, `storyView`, `storyMedia`) VALUES
(10, 'Luigi Cavanna', '2020-04-19', 'HEROES OF THE FRONT LINES 2.0', 'In early March, when the epidemic hit, the situation in the E.R. was extreme. People were coming in all the time, dozens of them, already in serious condition. Beds and stretchers everywhere.\r\n\r\nOne of my patients was in the E.R. for 10 hours and then she signed a paper stating that she wanted to be taken home. She said she’d rather die in her own bed. So I visited her at home and gave her some medicine. Within a few weeks, she got better. That’s when I realized we shouldn’t be waiting for the COVID-19 patients to get to the hospital. We needed to go to people’s homes, even of those with mild symptoms, and treat the disease before it could get worse. In the beginning the rallying call was to increase the number of hospital beds and all our efforts were directed towards that objective, but in doing so we were overlooking the territory.\r\n\r\nWe’ve got to remember that COVID-19 is not a heart attack or a stroke. It follows its course, and we must stop the action of the virus before the lungs are too seriously damaged. If you enter the spiral of the hospital already in serious condition, you don’t always manage to leave. I started to drive around the area surrounding Piacenza with my staff on March 10, and initially we visited as many as 15 people a day. Then we gradually became better organized, and now we have three teams and we continue to work also in the hospital.\r\n\r\nWhen we go to patients’ homes, we do a chest ultrasound with a device the size of a cell phone, but no swabs. In this area, anyone who shows the typical symptoms of COVID-19 is almost certainly positive. We leave the swabs for later, when patients have recovered, to make sure they’re no longer contagious. Up until April 2, we left two medicines to be taken by mouth, hydroxychloroquine commonly used for rheumatoid arthritis and an antiviral used for HIV. Then AIFA [Italy’s equivalent to FDA] issued a note advising us to be very careful in prescribing them together, and so now, except in rare cases, we use only hydroxychloroquine. We also leave other support devices such as an oximeter, or tanks of oxygen. Above all, we stay in touch with the patients and their families, and monitor the course of treatment on a daily basis.\r\n\r\nKeep up to date on the growing threat to global health by signing up for our daily coronavirus newsletter.\r\n\r\nSo far we have visited almost 300 patients. We can do this thanks to the hospital’s resources and private donations of protective equipment. Every time we enter a patient’s home we wear two gowns, two masks, caps, shoe covers. We’re extremely careful. I’m almost embarrassed to say this, but even when I’m at home with my wife, I keep the mask on.\r\n\r\nI’m one of those doctors who could have retired, but I chose not to. I’m not an alarmist by nature, but this is a tragedy. And we all need to do what we can, and what we can do best, to deal with it.', 10, );
INSERT INTO `story` (`storyID`, `storyAuthor`, `storyDate`, `storyTitle`, `storyBoard`, `storyView`, `storyMedia`) VALUES
(11, 'Francesco Menchise', '2020-04-19', 'HEROES OF THE FRONT LINES 3.0', 'Intubation operations are those where you are most exposed to the patient’s aerosol. You might sweat inside the protective gear, but it’s necessary. Our team consists of eight people plus a coordinator expert in emergencies and natural disasters. We are used to being under pressure, but we have never been under as much pressure as we are now. There’s been no lack of protective equipment (PPE), but of course we are all afraid of getting infected. Fortunately, so far no one has shown any symptoms.\r\n\r\nThe most obvious effect of the stress is that I no longer sleep well. I work about the same number of hours as before, 40 a week, but it’s more demanding on a mental level. Our patients remain on the ward for two or three weeks, much longer than on an average before the COVID-19 epidemic. More than 50% of those intubated don’t make it, and one of the most painful aspects of these deaths is that relatives cannot see their loved ones one last time.\r\n\r\nMy personal therapy is cooking. When I can, I cook. Like all Italians at this moment, those who cooked already cook more, those who didn’t cook have started to. We’ve all become 100% Italian again.\r\n\r\nBut we will have to roll up our sleeves for a long time. We must get it into our heads that our lives have changed, and until we find a therapy we have to learn to live with this virus.', 28, );

